list.item:
Kålund gekk frá handritinu til skráningar 30. september 1887 (
   Katalog I 1889:710 (nr. 1385)
).

origin.p:
Handritið var skrifað á Íslandi. Það er tímasett til 17. aldar (
                              Katalog I 1889:710
                        ). Að öllum líkindum hluti af stærra handriti (sbr. fastan seðil fremst).
